(1, 'TERMS AND CONDITIONS', 'By using Pricemanager.pk (`Site\') you agree to these terms and conditions, privacy policy, returns and refund policy of the Site. Please read the Terms and Conditions carefully before using Pricemanager.pk.', 'Pricemanager.pk (`سائٹ \') استعمال کرکے آپ ان شرائط و ضوابط ، رازداری کی پالیسی ، واپسی اور سائٹ کی واپسی کی پالیسی سے اتفاق کرتے ہیں۔ براہ کرم Pricemanager.pk استعمال کرنے سے پہلے شرائط و ضوابط کو غور سے پڑھیں۔', '2021-10-07 17:47:23', '2021-10-12 17:16:25'),
(2, 'INTRODUCTION', 'Welcome to Pricemanager.pk also hereby known as \"we\", \"us\" or \"Pricemanager\". We are an online marketplace and these are the terms and conditions governing your access and use of Pricemanager along with its related sub-domains, sites, mobile app, services and tools (the \"Site\"). By using the Site, you hereby accept these terms and conditions (including the linked information herein) and represent that you agree to comply with these terms and conditions (the \"User Agreement\"). This User Agreement is deemed effective upon your use of the Site which signifies your acceptance of these terms. If you do not agree to be bound by this User Agreement please do not access, register with or use this Site. This Site is owned and operated by Red Bricks Solution.\r\n\r\nThe Site reserves the right to change, modify, add, or remove portions of these Terms and Conditions at any time without any prior notification. Changes will be effective when posted on the Site with no other notice provided. Please check these Terms and Conditions regularly for updates. Your continued use of the Site following the posting of changes to Terms and Conditions of use constitutes your acceptance of those changes.', 'Pricemanager.pk میں خوش آمدید جسے اس طرح \"ہم\" ، \"ہم\" یا \"پرائس مینجر\" کے نام سے بھی جانا جاتا ہے۔ ہم ایک آن لائن مارکیٹ پلیس ہیں اور یہ شرائط و ضوابط ہیں جو آپ کی رسائی اور پرائس مینجر کے استعمال کو اس کے متعلقہ سب ڈومینز ، سائٹس ، موبائل ایپ ، سروسز اور ٹولز (\"سائٹ\") کے ساتھ کنٹرول کرتی ہیں۔ سائٹ کا استعمال کرتے ہوئے ، آپ اس طرح ان شرائط و ضوابط کو قبول کرتے ہیں (بشمول اس میں منسلک معلومات) اور نمائندگی کرتے ہیں کہ آپ ان شرائط و ضوابط (\"صارف کا معاہدہ\") کی تعمیل پر متفق ہیں۔ یہ صارف کا معاہدہ آپ کے سائٹ کے استعمال پر مؤثر سمجھا جاتا ہے جو ان شرائط کو قبول کرنے کی علامت ہے۔ اگر آپ اس صارف معاہدے کے پابند ہونے سے متفق نہیں ہیں تو براہ کرم اس سائٹ تک رسائی ، رجسٹر یا استعمال نہ کریں۔ یہ سائٹ ریڈ برکس سلوشن کی ملکیت ہے اور چلتی ہے۔\r\n\r\nسائٹ کسی بھی پیشگی اطلاع کے بغیر کسی بھی وقت ان شرائط و ضوابط کے حصوں کو تبدیل کرنے ، تبدیل کرنے ، شامل کرنے یا ہٹانے کا حق محفوظ رکھتی ہے۔ تبدیلیاں اس وقت مؤثر ہوں گی جب سائٹ پر کوئی دوسرا نوٹس فراہم نہیں کیا جائے گا۔ براہ کرم اپ ڈیٹس کے لیے ان شرائط و ضوابط کو باقاعدگی سے چیک کریں۔ استعمال کی شرائط و ضوابط میں تبدیلیوں کی پوسٹنگ کے بعد سائٹ کا آپ کا مسلسل استعمال ان تبدیلیوں کو آپ کی قبولیت کو تشکیل دیتا ہے۔', '2021-10-07 22:16:50', '2021-10-12 16:31:47'),
(3, 'YOUR ACCOUNT', 'To access certain services offered by the platform, we may require that you create an account with us or provide personal information to complete the creation of an account. We may at any time in our sole and absolute discretion, invalidate the username and/or password without giving any reason or prior notice and shall not be liable or responsible for any losses suffered by, caused by, arising out of, in connection with or by reason of such request or invalidation.\r\n\r\nYou are responsible for maintaining the confidentiality of your user identification, password, account details and related private information. You agree to accept this responsibility and ensure your account and its related details are maintained securely at all times and all necessary steps are taken to prevent misuse of your account. You should inform us immediately if you have any reason to believe that your password has become known to anyone else, or if the password is being, or is likely to be, used in an unauthorized manner. You agree and acknowledge that any use of the Site and related services offered and/or any access to private information, data or communications using your account and password shall be deemed to be either performed by you or authorized by you as the case may be. You agree to be bound by any access of the Site and/or use of any services offered by the Site (whether such access or use are authorized by you or not). You agree that we shall be entitled (but not obliged) to act upon, rely on or hold you solely responsible and liable in respect thereof as if the same were carried out or transmitted by you. You further agree and acknowledge that you shall be bound by and agree to fully indemnify us against any and all losses arising from the use of or access to the Site through your account.\r\n\r\nPlease ensure that the details you provide us with are correct and complete at all times. You are obligated to update details about your account in real time by accessing your account online. For pieces of information you are not able to update by accessing Your Account on the Site, you must inform us via our customer service communication channels to assist you with these changes. We reserve the right to refuse access to the Site, terminate accounts, remove or edit content at any time without prior notice to you. We may at any time in our sole and absolute discretion, request that you update your Personal Data or forthwith invalidate the account or related details without giving any reason or prior notice and shall not be liable or responsible for any losses suffered by or caused by you or arising out of or in connection with or by reason of such request or invalidation. You hereby agree to change your password from time to time and to keep your account secure and also shall be responsible for the confidentiality of your account and liable for any disclosure or use (whether such use is authorised or not) of the username and/or password.', 'پلیٹ فارم کے ذریعہ پیش کردہ کچھ خدمات تک رسائی حاصل کرنے کے لیے ، ہم یہ تقاضا کر سکتے ہیں کہ آپ ہمارے ساتھ اکاؤنٹ بنائیں یا اکاؤنٹ کی تخلیق مکمل کرنے کے لیے ذاتی معلومات فراہم کریں۔ ہم کسی بھی وقت اپنی مکمل اور مکمل صوابدید پر ، صارف نام اور/یا پاس ورڈ کو بغیر کسی وجہ یا پیشگی اطلاع کے کالعدم کر سکتے ہیں اور اس کے نتیجے میں پیدا ہونے والے کسی بھی نقصان کے ذمہ دار یا ذمہ دار نہیں ہوں گے۔ اس طرح کی درخواست یا باطل کی وجہ سے۔\r\nآپ اپنے صارف کی شناخت ، پاس ورڈ ، اکاؤنٹ کی تفصیلات اور متعلقہ نجی معلومات کی رازداری کو برقرار رکھنے کے ذمہ دار ہیں۔ آپ اس ذمہ داری کو قبول کرنے پر راضی ہیں اور اس بات کو یقینی بناتے ہیں کہ آپ کا اکاؤنٹ اور اس سے متعلقہ تفصیلات ہر وقت محفوظ طریقے سے برقرار رکھی جائیں اور آپ کے اکاؤنٹ کے غلط استعمال کو روکنے کے لیے تمام ضروری اقدامات کیے جائیں۔ اگر آپ کو یقین ہے کہ آپ کا پاس ورڈ کسی اور کو معلوم ہو گیا ہے ، یا اگر پاس ورڈ غیر مجاز طریقے سے استعمال کیا جا رہا ہے ، یا ہونے کا امکان ہے تو آپ کو فوری طور پر ہمیں مطلع کرنا چاہیے۔ آپ اس بات سے اتفاق کرتے ہیں اور تسلیم کرتے ہیں کہ سائٹ اور متعلقہ خدمات کے کسی بھی استعمال اور/یا آپ کے اکاؤنٹ اور پاس ورڈ کا استعمال کرتے ہوئے نجی معلومات ، ڈیٹا یا مواصلات تک رسائی کو یا تو آپ کے ذریعہ انجام دیا جائے گا یا آپ کے ذریعہ اختیار شدہ سمجھا جائے گا۔ آپ سائٹ کی کسی بھی رسائی اور/یا سائٹ کی طرف سے پیش کردہ کسی بھی خدمات کے استعمال کے پابند ہونے پر رضامند ہیں (چاہے ایسی رسائی یا استعمال آپ کے اختیار میں ہے یا نہیں)۔ آپ اس بات سے اتفاق کرتے ہیں کہ ہم اس پر عمل کرنے ، انحصار کرنے یا اس کے حوالے سے آپ کو مکمل طور پر ذمہ دار اور ذمہ دار ٹھہرانے کے حقدار ہوں گے (لیکن اس کے پابند نہیں) جیسے کہ یہ آپ کے ذریعہ کیا گیا ہو یا منتقل کیا گیا ہو۔ آپ مزید اتفاق کرتے ہیں اور تسلیم کرتے ہیں کہ آپ اپنے اکاؤنٹ کے ذریعے سائٹ کے استعمال یا رسائی سے پیدا ہونے والے کسی بھی اور تمام نقصانات کے خلاف ہمیں مکمل طور پر معاوضہ دینے کے پابند اور متفق ہوں گے۔\r\nبراہ کرم اس بات کو یقینی بنائیں کہ جو تفصیلات آپ ہمیں فراہم کرتے ہیں وہ ہر وقت درست اور مکمل ہیں۔ آپ اپنے اکاؤنٹ تک آن لائن رسائی حاصل کرکے اپنے اکاؤنٹ کے بارے میں تفصیلات اپ ڈیٹ کرنے کے پابند ہیں۔ معلومات کے ٹکڑوں کے لیے جو آپ سائٹ پر اپنے اکاؤنٹ تک رسائی حاصل کرنے کے قابل نہیں ہیں ، آپ کو ان تبدیلیوں میں آپ کی مدد کے لیے ہمارے کسٹمر سروس مواصلاتی چینلز کے ذریعے ہمیں مطلع کرنا چاہیے۔ ہم آپ کو بغیر کسی پیشگی اطلاع کے کسی بھی وقت سائٹ تک رسائی سے انکار ، اکاؤنٹس ختم کرنے ، مواد کو ہٹانے یا ترمیم کرنے کا حق محفوظ رکھتے ہیں۔ ہم کسی بھی وقت اپنی مکمل اور مکمل صوابدید پر ، درخواست کر سکتے ہیں کہ آپ اپنا ذاتی ڈیٹا اپ ڈیٹ کریں یا بغیر کسی وجہ یا پیشگی اطلاع کے اکاؤنٹ یا متعلقہ تفصیلات کو کالعدم قرار دے دیں اور آپ کو پہنچنے والے یا ہونے والے نقصانات کے ذمہ دار یا ذمہ دار نہیں ہوں گے یا اس طرح کی درخواست یا ناجائز کی وجہ سے یا اس کے ساتھ یا اس سے پیدا ہونا۔ آپ اس کے ذریعے وقتا فوقتا password اپنا پاس ورڈ تبدیل کرنے اور اپنے اکاؤنٹ کو محفوظ رکھنے کے لیے رضامند ہیں اور آپ کے اکاؤنٹ کی رازداری کے لیے بھی ذمہ دار ہوں گے اور صارف نام اور/یا کسی بھی انکشاف یا استعمال کے لیے ذمہ دار ہوں گے (چاہے ایسا استعمال مجاز ہے یا نہیں) پاس ورڈ', '2021-10-07 22:17:16', '2021-10-12 16:34:44'),
(4, 'PRIVACY', 'Please review our Privacy Agreement, which also governs your visit to the Site. The personal information / data provided to us by you or your use of the Site will be treated as strictly confidential, in accordance with the Privacy Agreement and applicable laws and regulations. If you object to your information being transferred or used in the manner specified in the Privacy Agreement, please do not use the Site.', 'براہ کرم ہمارے پرائیویسی معاہدے کا جائزہ لیں ، جو سائٹ پر آپ کے وزٹ کو بھی کنٹرول کرتا ہے۔ پرائیویسی معاہدے اور قابل اطلاق قوانین اور قواعد و ضوابط کے مطابق ، آپ کے ذریعہ یا سائٹ کے استعمال سے ہمیں فراہم کردہ ذاتی معلومات / ڈیٹا کو سختی سے خفیہ سمجھا جائے گا۔ اگر آپ کو اپنی معلومات کی منتقلی یا رازداری کے معاہدے میں بیان کردہ طریقے سے استعمال کرنے پر اعتراض ہے تو براہ کرم سائٹ کا استعمال نہ کریں۔', '2021-10-12 16:35:35', '2021-10-12 16:35:35'),
