(6, 'CONTINUED AVAILABILITY OF THE SITE', 'We will do our utmost to ensure that access to the Site is consistently available and is uninterrupted and error-free. However, due to the nature of the Internet and the nature of the Site, this cannot be guaranteed. Additionally, your access to the Site may also be occasionally suspended or restricted to allow for repairs, maintenance, or the introduction of new facilities or services at any time without prior notice. We will attempt to limit the frequency and duration of any such suspension or restriction.', 'ہم اس بات کو یقینی بنانے کی پوری کوشش کریں گے کہ سائٹ تک رسائی مسلسل دستیاب ہو اور بلا روک ٹوک اور غلطی سے پاک ہو۔ تاہم ، انٹرنیٹ کی نوعیت اور سائٹ کی نوعیت کی وجہ سے ، اس کی ضمانت نہیں دی جا سکتی۔ مزید برآں ، سائٹ تک آپ کی رسائی کبھی کبھار معطل یا محدود ہوسکتی ہے تاکہ کسی بھی وقت بغیر کسی پیشگی اطلاع کے مرمت ، دیکھ بھال ، یا نئی سہولیات یا خدمات کے تعارف کی اجازت دی جا سکے۔ ہم کوشش کریں گے کہ اس طرح کی کسی بھی معطلی یا پابندی کی تعدد اور مدت کو محدود کریں۔', '2021-10-12 16:37:17', '2021-10-12 16:37:17'),
