as deemed illegal by The Islamic Republic of Pakistan.\r\nUse or upload, in any way, any software or material that contains, or which you have reason to suspect that contains, viruses, damaging components, malicious code or harmful components which may impair or corrupt the Site\'s data or damage or interfere with the operation of another Customer\'s computer or mobile device or the Site and use the Site other than in conformance with the acceptable use policies of any connected computer networks, any applicable Internet standards and any other applicable laws.', 'ہماری ضرورت ہے کہ سائٹ تک رسائی حاصل کرکے ، آپ تصدیق کرتے ہیں کہ آپ قانونی طور پر پابند معاہدے کر سکتے ہیں اور اس وجہ سے آپ تصدیق کرتے ہیں کہ آپ کی عمر کم از کم 18 سال ہے یا والدین یا قانونی سرپرست کی نگرانی میں سائٹ تک رسائی حاصل کر رہے ہیں۔ ہم آپ کو سائٹ کو فروخت کرنے کے لیے درج فہرست تعمیرات سے متعلقہ مصنوعات اور خدمات کی خریداری کے مقاصد کے لیے ، یہاں بیان کردہ شرائط و ضوابط کے مطابق ، سائٹ کو استعمال کرنے کے لیے ناقابل منتقلی ، منسوخ اور غیر خصوصی لائسنس دیتے ہیں۔ کسی تیسرے فریق کی جانب سے تجارتی استعمال یا استعمال ممنوع ہے ، سوائے اس کے کہ ہماری طرف سے پیشگی طور پر اجازت دی گئی ہو۔ اگر آپ ایک کاروباری ادارے کے طور پر رجسٹر کر رہے ہیں تو ، آپ نمائندگی کرتے ہیں کہ آپ کو اس صارف کے معاہدے کے پابند کرنے کا اختیار ہے اور یہ کہ آپ اور کاروباری ادارہ آن لائن ٹریڈنگ سے متعلق تمام قابل اطلاق قوانین کی تعمیل کریں گے۔ کوئی شخص یا کاروباری ادارہ ایک سے زیادہ مرتبہ سائٹ کے ممبر کے طور پر رجسٹر نہیں کر سکتا۔ ان شرائط و ضوابط کی کسی بھی خلاف ورزی کے نتیجے میں آپ کو بغیر اطلاع کے اس پیراگراف میں دیے گئے لائسنس کو فوری طور پر منسوخ کر دیا جائے گا۔\r\nاس سائٹ پر فراہم کردہ مواد صرف معلوماتی مقاصد کے لیے ہے۔ پروڈکٹ کی نمائندگی بشمول قیمت ، دستیاب اسٹاک ، فیچرز ، ایڈونس اور دیگر کوئی بھی تفصیلات جیسا کہ اس سائٹ پر بیان کیا گیا ہے دکانداروں کی ذمہ داری ہے کہ وہ ان کو ظاہر کریں اور ہماری طرف سے مکمل طور پر درست ہونے کی ضمانت نہیں ہے۔ اس سائٹ پر پیش کی جانے والی آراء یا آراء انفرادی افراد کی ہیں جو اس طرح کا مواد شائع کرتے ہیں اور ہماری رائے کی عکاسی نہیں کرسکتے ہیں۔\r\nہم آپ کو اس سائٹ تک رسائی اور ذاتی استعمال کے لیے ایک محدود لائسنس دیتے ہیں ، لیکن ڈاؤن لوڈ کرنے کے لیے نہیں (صفحے کیچز کو چھوڑ کر) یا کسی بھی طرح سے سائٹ یا اس کے کسی بھی حصے میں ترمیم نہیں کریں گے۔ اس لائسنس میں اس سائٹ یا اس کے مندرجات کا کوئی بھی دوبارہ فروخت یا تجارتی استعمال شامل نہیں ہے۔ کسی بھی مصنوعات کی لسٹنگ ، تفصیل ، یا قیمتوں کا کوئی مجموعہ اور استعمال؛ اس سائٹ یا اس کے مندرجات کا کوئی مشتق استعمال کسی دوسرے بیچنے والے کے فائدے کے لیے اکاؤنٹ کی معلومات کو ڈاؤن لوڈ یا کاپی کرنا یا ڈیٹا مائننگ ، روبوٹ ، یا اسی طرح کا ڈیٹا اکٹھا کرنے اور نکالنے کے ٹولز کا کوئی استعمال۔\r\nیہ سائٹ یا اس کا کوئی بھی حصہ (بشمول لیکن کسی کاپی رائٹ مواد ، ٹریڈ مارک ، یا دیگر ملکیتی معلومات تک محدود نہیں) دوبارہ پیش ، نقل ، نقل ، فروخت ، دوبارہ فروخت ، ملاحظہ ، تقسیم یا دوسری صورت میں کسی بھی تجارتی مقصد کے لیے استعمال نہیں کیا جا سکتا۔ ہماری طرف سے رضامندی جیسا کہ قابل اطلاق ہو۔\r\n\r\nآپ ہماری واضح تحریری رضامندی کے بغیر کسی بھی ٹریڈ مارک ، لوگو ، یا دیگر ملکیتی معلومات (بشمول تصاویر ، متن ، صفحہ ترتیب ، یا فارم) کو بند کرنے کے لیے فریمنگ تکنیک کو فریم یا استعمال نہیں کرسکتے ہیں۔ آپ کسی بھی میٹا ٹیگ یا کسی دوسرے متن کو استعمال نہیں کر سکتے جو ہمارے نام یا ٹریڈ مارک کو استعمال کرتے ہوئے ہماری ایکسپریس تحریری رضامندی کے بغیر لاگو ہو۔ کوئی بھی غیر مجاز استعمال بغیر اجازت کے سائٹ تک رسائی کے لیے ہماری طرف سے دی گئی اجازت یا لائسنس کو ختم کردیتا ہے۔ آپ ہماری علامت (لوگو) یا دیگر ملکیتی گرافک یا ٹریڈ مارک کو بیرونی لنک کے حصے کے طور پر تجارتی یا دیگر مقاصد کے لیے ہماری ایکسپریس تحریری رضامندی کے بغیر استعمال نہیں کر سکتے ، جیسا کہ لاگو ہو سکتا ہے۔\r\nآپ اتفاق کرتے ہیں اور اس سیکشن میں درج محدود سرگرمیوں کو انجام نہ دینے کا عہد کرتے ہیں۔ ان سرگرمیوں کو انجام دینے کے نتیجے میں آپ کا اکاؤنٹ ، خدمات ، جائزے ، احکامات یا ہمارے ساتھ موجودہ نامکمل لین دین کو فوری طور پر منسوخ کر دیا جائے گا اور سنگین صورتوں میں قانونی کارروائی بھی ہو سکتی ہے\r\n\r\nیہاں بیان کردہ شرائط و ضوابط یا سائٹ کے استعمال سے متعلق کسی بھی دوسری ہدایات اور پالیسیوں کی تعمیل کرنے سے انکار ہر وقت سائٹ پر دستیاب ہے۔\r\nکسی بھی شخص یا ادارے کی نقالی کریں یا جھوٹے بیان دیں یا دوسری صورت میں کسی بھی شخص یا ادارے کے ساتھ آپ کی وابستگی کی غلط تشریح کریں۔\r\nسائٹ کو غیر قانونی مقاصد کے لیے استعمال کریں۔\r\nپلیٹ فارم یا خدمات سے منسلک دوسرے کمپیوٹر سسٹمز یا نیٹ ورکس تک غیر مجاز رسائی حاصل کرنے یا دوسری صورت میں مداخلت یا خلل ڈالنے کی کوشش۔\r\nکسی دوسرے کے استعمال اور سائٹ سے لطف اندوز ہونے میں مداخلت\r\nاسلامی جمہوریہ پاکستان کی طرف سے غیر قانونی سمجھے جانے والے کسی بھی ممنوعہ مواد کو سائٹ کے ذریعے پوسٹ ، پروموٹ یا منتقل کریں۔\r\nکسی بھی طرح سے ، کسی بھی سافٹ ویئر یا مواد کو استعمال کریں یا اپ لوڈ کریں ، یا جس پر آپ کو شک ہے کہ اس میں وائرس ، نقصان دہ اجزاء ، بدنیتی پر مبنی کوڈ یا نقصان دہ اجزاء ہیں جو سائٹ کے ڈیٹا کو خراب یا خراب کرسکتے ہیں یا آپریشن میں مداخلت کرسکتے ہیں۔ کسی دوسرے کسٹمر کے کمپیوٹر یا موبائل ڈیوائس یا سائٹ کا اور کسی بھی منسلک کمپیوٹر نیٹ ورکس کے قابل قبول استعمال کی پالیسیوں ، کسی بھی قابل اطلاق انٹرنیٹ معیار اور کسی بھی دوسرے قابل اطلاق قوانین کے مطابق سائٹ کے استعمال کے علاوہ۔', '2021-10-12 16:40:51', '2021-10-12 16:40:51'),
(8, 'YOUR CONDUCT', 'You must not use the website in any way that causes, or is likely to cause, the Site or access to it to be interrupted, damaged or impaired in any way. You must not engage in activities that could harm or potentially harm the Site, its employees, officers, representatives, stakeholders or any other party directly or indirectly associated with the Site or access to it to be interrupted, damaged or impaired in any way. You understand that you, and not us, are responsible for all electronic communications and content sent from your computer to us and you must use the Site for lawful purposes only. You are strictly prohibited from using the Site\r\nFor fraudulent purposes, or in connection with a criminal offense or other unlawful activity\r\nto send, use or reuse any material that does not belong to you; or is illegal, offensive (including but not limited to material that is sexually explicit content or which promotes racism, bigotry, hatred or physical harm), deceptive, misleading, abusive, indecent, harassing, blasphemous, defamatory, libellous, obscene, pornographic, paedophilic or menacing; ethnically objectionable, disparaging or in breach of copyright, trademark, confidentiality, privacy or any other proprietary information or right; or is otherwise injurious to third parties; or relates to or promotes money laundering or gambling; or is harmful to minors in any way; or impersonates another person; or threatens the unity, integrity, security or sovereignty of Pakistan or friendly relations with foreign States; or objectionable or otherwise unlawful in any manner whatsoever; or which consists of or contains software viruses, political campaigning, commercial solicitation, chain letters, mass mailings or any \"spam\".\r\nUse the Site for illegal purposes.\r\nTo cause annoyance, inconvenience or needless anxiety\r\nFor any other purposes that is other than what is intended by us', 'آپ کو ویب سائٹ کو کسی بھی طرح سے استعمال نہیں کرنا چاہیے جس کی وجہ سے ، یا اس کی رسائی کا سبب بنتا ہے ، یا اس تک رسائی کسی بھی طرح سے رکاوٹ ، نقصان یا خرابی کا باعث بنتی ہے۔ آپ کو ایسی سرگرمیوں میں مشغول نہیں ہونا چاہیے جو سائٹ کو نقصان پہنچائیں یا ممکنہ طور پر نقصان پہنچا سکیں ، اس کے ملازمین ، افسران ، نمائندے ، سٹیک ہولڈرز یا سائٹ کے ساتھ براہ راست یا بالواسطہ طور پر وابستہ کسی دوسرے فریق کو یا اس تک رسائی کو کسی بھی طرح سے رکاوٹ ، نقصان یا خرابی سے متاثر کیا جائے۔ آپ سمجھتے ہیں کہ آپ ، نہ کہ ہم ، آپ کے کمپیوٹر سے ہمیں بھیجے گئے تمام الیکٹرانک مواصلات اور مواد کے ذمہ دار ہیں اور آپ کو اس سائٹ کو صرف قانونی مقاصد کے لیے استعمال کرنا چاہیے۔ آپ کو سائٹ کے استعمال سے سختی سے منع کیا گیا ہے۔\r\nدھوکہ دہی کے مقاصد کے لیے ، یا کسی مجرمانہ جرم یا دیگر غیر قانونی سرگرمیوں کے سلسلے میں۔\r\nکسی بھی مواد کو بھیجنا ، استعمال کرنا یا دوبارہ استعمال کرنا جو آپ کا نہیں ہے یا غیر قانونی ، جارحانہ ہے (بشمول جنسی طور پر واضح مواد پر مشتمل ہے یا جو نسل پرستی ، تعصب ، نفرت یا جسمانی نقصان کو فروغ دیتا ہے) ، دھوکہ دہی ، گمراہ کن ، بدسلوکی ، بے حیائی ، ہراساں کرنا ، گستاخانہ ، بدنام کرنے والا ، فحش ، فحش ، فحش پیڈوفیلک یا خطرہ نسلی طور پر قابل اعتراض ، توہین آمیز یا حق اشاعت کی خلاف ورزی ، ٹریڈ مارک ، رازداری ، رازداری یا کوئی دوسری ملکیتی معلومات یا حق؛ یا دوسری صورت میں تیسرے فریق کے لیے نقصان دہ ہے۔ یا منی لانڈرنگ یا جوئے سے متعلق ہے یا اس کو فروغ دیتا ہے۔ یا کسی بھی طرح سے نابالغوں کے لیے نقصان دہ ہے۔ یا کسی دوسرے شخص کی نقالی کرتا ہے یا پاکستان کی وحدت ، سالمیت ، سلامتی یا خودمختاری یا غیر ملکی ریاستوں کے ساتھ دوستانہ تعلقات کو خطرہ ہے۔ یا کسی بھی طریقے سے قابل اعتراض یا دوسری صورت میں غیر قانونی؛ یا جو سافٹ وئیر وائرس ، سیاسی مہم ، تجارتی درخواست ، چین لیٹر ، بڑے پیمانے پر میلنگ یا کسی بھی \"سپیم\" پر مشتمل ہے یا اس پر مشتمل ہے۔\r\nسائٹ کو غیر قانونی مقاصد کے لیے استعمال کریں۔\r\nپریشانی ، تکلیف یا بے ضرورت پریشانی کا سبب بننا۔\r\nکسی دوسرے مقاصد کے لیے جو ہمارے ارادہ کے علاوہ ہے۔', '2021-10-12 16:46:04', '2021-10-12 16:46:04'),
(9, 'YOUR SUBMISSION', 'Anything that you submit to the Site and/or provide to us, including but not limited to, questions, reviews, comments, and suggestions (collectively, \"Submissions\") will become our sole and exclusive property and shall not be returned to you. In addition to the rights applicable to any Submission, when you post comments or reviews to the Site, you also grant us the right to use the name that you submit, in connection with such review, comment, or other content. You shall not use a false e-mail address, pretend to be someone other than yourself or otherwise mislead us or third parties as to the origin of any Submissions. We may, but shall not be obligated to, remove or edit any Submissions without any notice or legal course applicable to us in this regard.', 'کوئی بھی چیز جو آپ سائٹ پر جمع کرتے ہیں اور/یا ہمیں فراہم کرتے ہیں ، بشمول سوالات ، جائزے ، تبصرے ، اور تجاویز (اجتماعی طور پر ، \"جمع کرانے\") تک محدود نہیں بلکہ ہماری واحد اور خصوصی جائیداد بن جائے گی اور آپ کو واپس نہیں کی جائے گی۔ کسی بھی جمع کرانے پر لاگو حقوق کے علاوہ ، جب آپ سائٹ پر تبصرے یا جائزے شائع کرتے ہیں ، تو آپ ہمیں یہ بھی حق دیتے ہیں کہ آپ جو نام جمع کرواتے ہیں ، اس طرح کے جائزے ، تبصرہ یا دیگر مواد کے سلسلے میں استعمال کریں۔ آپ جھوٹا ای میل پتہ استعمال نہ کریں ، اپنے علاوہ کسی اور کا بہانہ کریں یا دوسری صورت میں ہمیں یا تیسرے فریق کو گمراہ کریں کہ کسی بھی جمع کی اصل ہے۔ ہم کسی بھی نوٹیفکیشن یا اس سلسلے میں ہمارے لیے لاگو ہونے والے قانونی کورس کے بغیر کسی بھی درخواست کو ہٹانے یا اس میں ترمیم کرنے کے پابند نہیں ہوں گے۔', '2021-10-12 16:46:48', '2021-10-12 16:46:48'),
