نے سے پہلے اپنے بہترین اور سمجھدار فیصلے کو استعمال کر رہے ہیں۔ ہم نہ تو ذمہ دار ہوں گے اور نہ ہی بیچنے والوں کے کسی عمل یا غیرفعالیت کے لیے اور نہ ہی شرائط کی خلاف ورزی کے لیے ، مصنوعات کے بیچنے والے یا مینوفیکچررز کی طرف سے نمائندگی یا وارنٹی اور اس طرح واضح طور پر دستبرداری اور اس سلسلے میں تمام ذمہ داری اور ذمہ داری ہم ثالثی نہیں کریں گے اور نہ ہی آپ کے اور بیچنے والے یا مصنوعات بنانے والوں کے درمیان کسی تنازعہ یا اختلاف کو حل کریں گے۔\r\n\r\nہم معیار ، مناسبیت ، درستگی ، وشوسنییتا ، مکمل ، بروقت ، کارکردگی ، حفاظت ، مرچنٹیبلٹی ، کسی خاص مقصد کے لیے فٹنس ، یا درج کردہ مصنوعات کی قانونی حیثیت ، یا ظاہر کردہ یا لین دین کے حوالے سے کسی بھی وارنٹی یا نمائندگی (ایکسپریس یا ضمنی) کو مزید واضح طور پر مسترد کرتے ہیں۔ یا سائٹ پر مواد (بشمول پروڈکٹ یا قیمتوں کی معلومات اور/یا وضاحتیں)۔ اگرچہ ہم نے مواد میں غلطیوں سے بچنے کے لیے احتیاطی تدابیر اختیار کی ہیں ، یہ سائٹ ، تمام مواد ، معلومات (بشمول مصنوعات کی قیمت) ، سافٹ ویئر ، مصنوعات ، خدمات اور متعلقہ گرافکس کسی بھی قسم کی وارنٹی کے بغیر فراہم کیے گئے ہیں۔ ہم سائٹ پر کسی بھی مصنوعات کی فروخت یا خریداری کی واضح یا واضح طور پر حمایت یا تائید نہیں کرتے ہیں۔ کسی بھی وقت ہمارے پاس سائٹ بنیان کے ذریعے فروخت یا دکھائی جانے والی مصنوعات میں کوئی حق ، عنوان یا دلچسپی نہیں ہوگی اور نہ ہی پرائس مینیجر کی سائٹ پر کسی بھی لین دین کے حوالے سے کوئی ذمہ داری یا ذمہ داری ہوگی۔\r\n\r\nہم نہ تو کسی بھی دوسرے سروس فراہم کرنے والے کے کسی بھی عمل یا غیر فعال ہونے کے ذمہ دار یا ذمہ دار نہیں ہوں گے جیسا کہ ہماری سائٹ پر درج ہے جس میں ادائیگی فراہم کرنے والوں ، قسطوں کی پیشکش ، وارنٹی خدمات شامل ہیں لیکن ان تک محدود نہیں ہے۔', '2021-10-12 16:50:03', '2021-10-12 16:50:03'),
(14, 'INDEMNITY', 'You shall indemnify and hold harmless Pricemanager as owned by Pricemanager Singapore Private Limited, its subsidiaries, affiliates and their respective officers, directors, agents and employees, from any claim or demand, or actions including reasonable attorney\'s fees, made by any third party or penalty imposed due to or arising out of your breach of these Terms and Conditions or any document incorporated by reference, or your violation of any law, rules, regulations or the rights of a third party.\r\n\r\nYou hereby expressly release Pricemanager as owned by Pricemanager Singapore Private Limited and/or its affiliates and/or any of its officers and representatives from any cost, damage, liability or other consequence of any of the actions/inactions of the sellers or other service providers and specifically waiver any claims or demands that you may have in this behalf under any statute, contract or otherwise.', 'آپ پرائم مینجر سنگاپور پرائیویٹ لمیٹڈ ، اس کے ماتحت اداروں ، وابستہ افراد اور ان کے متعلقہ افسران ، ڈائریکٹرز ، ایجنٹوں اور ملازمین کی ملکیت کے طور پر کسی بھی دعویٰ یا مطالبہ ، یا مناسب وکیل کی فیس سمیت کسی بھی تیسرے فریق یا جرمانے کی کارروائیوں سے معاوضہ لیں گے۔ آپ کی ان شرائط و ضوابط کی خلاف ورزی کی وجہ سے یا اس کی وجہ سے یا کسی بھی دستاویز کے حوالہ سے ، یا کسی قانون ، قواعد ، ضوابط یا کسی تیسرے فریق کے حقوق کی خلاف ورزی کی وجہ سے عائد کیا گیا ہے۔\r\n\r\nآپ اس طرح پرائس مینجر کو پرائس مینجر سنگاپور پرائیویٹ لمیٹڈ اور/یا اس سے وابستہ اور/یا اس کے افسران اور نمائندوں میں سے کسی بھی قیمت ، نقصان ، ذمہ داری یا بیچنے والے یا دیگر سروس فراہم کرنے والوں کے کسی بھی عمل/غیر فعالیت کے نتیجے کے طور پر ظاہر کرتے ہیں۔ اور خاص طور پر کسی بھی دعوے یا مطالبے کو جو کہ آپ اس کی طرف سے کسی قانون ، معاہدے یا دوسری صورت میں رکھتے ہیں ، چھوٹ دیں۔', '2021-10-12 16:56:45', '2021-10-12 17:26:55'),
(15, 'THIRD PARTY BUSINESSES', 'Parties other than Pricemanager and its affiliates may operate stores, provide services, or sell product lines on the Site. For example, businesses and individuals offer products via Marketplace. In addition, we provide links to the websites of affiliated companies and certain other businesses. We are not responsible for examining or evaluating, and we do not warrant or endorse the offerings of any of these businesses or individuals, or the content of their websites. We do not assume any responsibility or liability for the actions, products, and content of any of these and any other third-parties. You can tell when a third-party is involved in your transactions by reviewing your transaction carefully, and we may share customer information related to those transactions with that third-party. You should carefully review their privacy statements and related terms and conditions.', 'پرائس مینیجر اور اس سے وابستہ دیگر جماعتیں سائٹ پر اسٹورز چلاتی ہیں ، خدمات مہیا کرتی ہیں یا پروڈکٹ لائنز فروخت کر سکتی ہیں۔ مثال کے طور پر ، کاروبار اور افراد مارکیٹ پلیس کے ذریعے مصنوعات پیش کرتے ہیں۔ اس کے علاوہ ، ہم وابستہ کمپنیوں اور بعض دیگر کاروباری اداروں کی ویب سائٹس کے لنکس فراہم کرتے ہیں۔ ہم جانچنے یا جانچنے کے ذمہ دار نہیں ہیں ، اور ہم ان کاروباروں یا افراد میں سے کسی کی پیشکش ، یا ان کی ویب سائٹس کے مواد کی ضمانت یا توثیق نہیں کرتے ہیں۔ ہم ان میں سے کسی اور دوسرے تیسرے فریق کے اعمال ، مصنوعات اور مواد کے لیے کوئی ذمہ داری یا ذمہ داری قبول نہیں کرتے ہیں۔ آپ بتا سکتے ہیں کہ جب کوئی تیسرا فریق آپ کے لین دین میں شامل ہوتا ہے آپ کے لین دین کا بغور جائزہ لے کر ، اور ہم ان لین دین سے متعلق کسٹمر کی معلومات اس تیسرے فریق کے ساتھ شیئر کر سکتے ہیں۔ آپ کو ان کے رازداری کے بیانات اور متعلقہ شرائط و ضوابط کا بغور جائزہ لینا چاہیے۔', '2021-10-12 16:57:30', '2021-10-12 17:27:22'),
(16, 'COMMUNICATING WITH US', 'When you visit the Site, or send e-mails to us, you are communicating with us electronically. You will be required to provide a valid phone number while placing an order with us. We may communicate with you by e-mail, SMS, phone call or by posting notices on the Site or by any other mode of communication we choose to employ. For contractual purposes, you consent to receive communications (including transactional, promotional and/or commercial messages), from us with respect to your use of the website (and/or placement of your order) and agree to treat all modes of communication with the same importance.\r\n\r\nPricemanager\'s Buyer-Seller Interaction Policy outlines the standard of behavior that sellers need to follow when connecting with customers on the Question & Answer Section, Instant Messenger, and Product Review Platform (of Pricemanager). Pricemanager monitors all kinds of buyer-seller communications and is authorized to take action in case of any violations.', 'جب آپ سائٹ پر جاتے ہیں ، یا ہمیں ای میل بھیجتے ہیں ، آپ ہمارے ساتھ الیکٹرانک طور پر بات چیت کر رہے ہیں۔ ہمارے ساتھ آرڈر دیتے وقت آپ کو ایک درست فون نمبر فراہم کرنا ہوگا۔ ہم آپ کے ساتھ ای میل ، ایس ایم ایس ، فون کال کے ذریعے یا سائٹ پر نوٹس شائع کر کے یا کسی دوسرے مواصلاتی طریقے سے جو ہم ملازمت کے لیے منتخب کرتے ہیں رابطہ کر سکتے ہیں۔ معاہدے کے مقاصد کے لیے ، آپ ویب سائٹ کے استعمال کے حوالے سے ہم سے مواصلات (بشمول لین دین ، ​​پروموشنل اور/یا تجارتی پیغامات) وصول کرنے کے لیے رضامند ہیں ایک ہی اہمیت\r\n\r\nپرائس مینجر کی خریدار بیچنے والی بات چیت کی پالیسی اس طرز عمل کے معیار کو بیان کرتی ہے جس پر سوال و جواب سیکشن ، انسٹنٹ میسنجر ، اور پروڈکٹ ریویو پلیٹ فارم (پرائس مینجر) پر صارفین سے رابطہ قائم کرتے وقت بیچنے والے کو پیروی کرنے کی ضرورت ہوتی ہے۔ پرائس مینجر ہر قسم کے خریدار بیچنے والے مواصلات پر نظر رکھتا ہے اور کسی بھی خلاف ورزی کی صورت میں کارروائی کرنے کا مجاز ہے۔', '2021-10-12 16:58:26', '2021-10-12 17:27:51'),
(17, 'LOSSES', 'We will not be responsible for any business or personal losses (including but not limited to loss of profits, revenue, contracts, anticipated savings, data, goodwill, or wasted expenditure) or any other indirect or consequential loss that is not reasonably foreseeable to both you and us when you commenced using the Site.', 'ہم کسی بھی کاروباری یا ذاتی نقصان کے ذمہ دار نہیں ہوں گے (بشمول منافع ، محصول ، معاہدے ، متوقع بچت ، ڈیٹا ، خیر سگالی ، یا ضائع ہونے والے اخراجات تک محدود نہیں) یا کوئی دوسرا بالواسطہ یا نتیجہ خیز نقصان جو دونوں کے لیے معقول حد تک پیش قیاسی نہیں ہے جب آپ نے سائٹ کا استعمال شروع کیا تو آپ اور ہم۔', '2021-10-12 17:00:53', '2021-10-12 17:28:15'),
(18, 'AMENDMENTS TO CONDITIONS OR ALTERATIONS OF SERVICE AND RELATED PROMISE', 'We reserve the right to make changes to the Site, its policies, these terms and conditions and any other publicly displayed condition or service promise at any time. You will be subject to the policies and terms and conditions in force at the time you used the Site unless any change to those policies or these conditions is required to be made by law or government authority (in which case it will apply to orders previously placed by you). If any of these conditions is deemed invalid, void, or for any reason unenforceable, that condition will be deemed severable and will not affect the validity and enforceability of any remaining condition.', 'ہم کسی بھی وقت سائٹ ، اس کی پالیسیوں ، ان شرائط و ضوابط اور عوامی طور پر دکھائی جانے والی کسی بھی دوسری حالت یا سروس وعدے میں تبدیلی کرنے کا حق محفوظ رکھتے ہیں۔ جب آپ نے سائٹ استعمال کی تھی تب تک آپ پالیسیوں اور شرائط و ضوابط کے تابع ہوں گے جب تک کہ ان پالیسیوں یا ان شرائط میں کوئی تبدیلی قانون یا حکومتی اتھارٹی کی طرف سے لانے کی ضرورت نہ ہو (ایسی صورت میں اس کا اطلاق پہلے دیے گئے احکامات پر ہوگا۔ آپ کی طرف سے). اگر ان شرائط میں سے کوئی بھی باطل ، باطل یا کسی بھی وجہ سے ناقابل عمل سمجھا جائے تو وہ شرط منقطع سمجھی جائے گی اور باقی کسی بھی حالت کی درستگی اور نفاذ کو متاثر نہیں کرے گی۔', '2021-10-12 17:02:23', '2021-10-12 17:30:18'),
(20, 'EVENTS BEYOND OUR CONTROL', 'We will not be held responsible for any delay or failure to comply with our obligations under these conditions if the delay or failure arises from any cause which is beyond our reasonable control. This condition does not affect your statutory rights.', 'تاخیر یا ناکامی ان شرائط کے تحت ہماری ذمہ داریوں کی تعمیل میں کسی تاخیر یا ناکامی کے لیے ذمہ دار نہیں ٹھہرائی جائے گی اگر تاخیر یا ناکامی کسی بھی وجہ سے پیدا ہوتی ہے جو ہمارے معقول کنٹرول سے باہر ہے۔ یہ شرط آپ کے قانونی حقوق کو متاثر نہیں کرتی۔', '2021-10-12 17:03:36', '2021-10-12 17:30:43'),
(21, 'WAIVER', 'You acknowledge and recognize that we are a private commercial enterprise and reserve the right to conduct business to achieve our objectives in a manner we deem fit. You also acknowledge that if you breach the conditions stated on our Site and we take no action, we are still entitled to use our rights and remedies in any other situation where you breach these conditions.', 'آپ تسلیم کرتے ہیں اور تسلیم کرتے ہیں کہ ہم ایک پرائیویٹ کمرشل انٹرپرائز ہیں اور اپنے مقاصد کو حاصل کرنے کے لیے کاروبار کرنے کا حق محفوظ رکھتے ہیں جس طرح ہم مناسب سمجھتے ہیں۔ آپ یہ بھی تسلیم کرتے ہیں کہ اگر آپ ہماری سائٹ پر بیان کردہ شرائط کی خلاف ورزی کرتے ہیں اور ہم کوئی کارروائی نہیں کرتے ہیں ، ہم اب بھی کسی بھی دوسری صورت حال میں اپنے حقوق اور علاج استعمال کرنے کے حقدار ہیں جہاں آپ ان شرائط کی خلاف ورزی کرتے ہیں۔', '2021-10-12 17:05:10', '2021-10-12 17:31:12');
