(23, 'GOVERNING LAW AND JURISDICTION', 'These terms and conditions are governed by and construed in accordance with the laws of The Islamic Republic of Pakistan. You agree, as we do, to submit to the exclusive jurisdiction of the courts in Karachi, Pakistan.', 'یہ شرائط و ضوابط اسلامی جمہوریہ پاکستان کے قوانین کے مطابق چلتے ہیں اور ان کی تشکیل کی جاتی ہے۔ آپ اتفاق کرتے ہیں ، جیسا کہ ہم کرتے ہیں ، کراچی ، پاکستان میں عدالتوں کے خصوصی دائرہ اختیار میں پیش کرنے کے لیے۔', '2021-10-12 17:07:31', '2021-10-12 17:07:31'),
(24, 'OUR SOFTWARE', 'Our software includes any software (including any updates or upgrades to the software and any related documentation) that we make available to you from time to time for your use in connection with the Site (the \"Software\").\r\n\r\nYou may use the software solely for purposes of enabling you to use and enjoy our services as permitted by the Terms and Conditions and any related applicable terms as available on the Site. You may not incorporate any portion of the Software into your own programs or compile any portion of it in combination with your own programs, transfer it for use with another service, or sell, rent, lease, lend, loan, distribute or sub-license the Software or otherwise assign any rights to the Software in whole or in part. You may not use the Software for any illegal purpose. We may cease providing you service and we may terminate your right to use the Software at any time. Your rights to use the Software will automatically terminate without notice from us if you fail to comply with any of the Terms and Conditions listed here or across the Site. Additional third party terms contained within the Site or distributed as such that are specifically identified in related documentation may apply and will govern the use of such software in the event of a conflict with these Terms and Conditions. All software used in any of our services is our property and/or our affiliates or its software suppliers and protected by the laws of Pakistan including but not limited to any other applicable copyright laws.\r\n\r\nWhen you use the Site, you may also be using the services of one or more third parties, such as a wireless carrier or a mobile platform provider. Your use of these third party services may be subject to separate policies, terms of use, and fees of these third parties.\r\n\r\nYou may not, and you will not encourage, assist or authorize any other person to copy, modify, reverse engineer, decompile or disassemble, or otherwise tamper with our software whether in whole or in part, or create any derivative works from or of the Software.\r\n\r\nIn order to keep the Software up-to-date, we may offer automatic or manual updates at any time and without notice to you.', 'ہمارے سافٹ وئیر میں کوئی بھی سافٹ وئیر شامل ہے (بشمول سافٹ ویئر کی اپ ڈیٹس یا اپ گریڈ اور متعلقہ دستاویزات) جو کہ ہم آپ کو وقتا from فوقتا available سائٹ (\"سافٹ ویئر\") کے سلسلے میں آپ کے استعمال کے لیے فراہم کرتے ہیں۔\r\n\r\nآپ سافٹ وئیر کو صرف اس مقصد کے لیے استعمال کر سکتے ہیں کہ آپ ہماری سروسز کو استعمال کرنے اور ان سے لطف اندوز کرنے کے قابل بنائیں جیسا کہ شرائط و ضوابط اور سائٹ پر دستیاب کسی بھی متعلقہ قابل اطلاق شرائط کی اجازت ہے۔ آپ سافٹ ویئر کے کسی حصے کو اپنے پروگراموں میں شامل نہیں کر سکتے یا اس کے کسی حصے کو اپنے پروگراموں کے ساتھ مل کر مرتب نہیں کر سکتے ، اسے کسی دوسری سروس کے ساتھ استعمال کرنے کے لیے منتقل کر سکتے ہیں ، یا فروخت ، کرایہ ، لیز ، قرض ، قرض ، تقسیم یا ذیلی لائسنس سافٹ ویئر یا دوسری صورت میں سافٹ ویئر کو مکمل یا جزوی طور پر کوئی حق تفویض کرتا ہے۔ آپ سافٹ ویئر کو کسی غیر قانونی مقصد کے لیے استعمال نہیں کر سکتے۔ ہم آپ کو سروس فراہم کرنا بند کر سکتے ہیں اور ہم کسی بھی وقت سافٹ ویئر استعمال کرنے کا آپ کا حق ختم کر سکتے ہیں۔ سافٹ ویئر کے استعمال کے آپ کے حقوق خود بخود ہماری اطلاع کے بغیر ختم ہو جائیں گے اگر آپ یہاں یا سائٹ پر درج کسی بھی شرائط و ضوابط کی تعمیل کرنے میں ناکام ہو جاتے ہیں۔ تیسری پارٹی کی اضافی شرائط جو سائٹ کے اندر موجود ہیں یا اس طرح تقسیم کی گئی ہیں جن کی متعلقہ دستاویزات میں خاص طور پر نشاندہی کی گئی ہے اور وہ ان شرائط و ضوابط سے متصادم ہونے کی صورت میں اس طرح کے سافٹ وئیر کے استعمال کو کنٹرول کر سکتی ہیں۔ ہماری کسی بھی سروس میں استعمال ہونے والے تمام سافٹ وئیر ہماری جائیداد اور/یا ہمارے ملحقہ یا اس کے سافٹ وئیر سپلائرز ہیں اور پاکستان کے قوانین سے محفوظ ہیں جن میں کاپی رائٹ کے دیگر قابل اطلاق قوانین شامل ہیں لیکن یہ محدود نہیں ہیں۔\r\n\r\nجب آپ سائٹ استعمال کرتے ہیں تو ، آپ ایک یا زیادہ تیسری پارٹیوں کی خدمات بھی استعمال کر رہے ہوں گے ، جیسے وائرلیس کیریئر یا موبائل پلیٹ فارم مہیا کرنے والا۔ ان تیسرے فریق کی خدمات کا آپ کا استعمال الگ الگ پالیسیوں ، استعمال کی شرائط اور ان تیسرے فریق کی فیسوں کے تابع ہوسکتا ہے۔\r\n\r\nآپ نہیں کر سکتے ، اور آپ کسی دوسرے شخص کو کاپی ، ترمیم ، ریورس انجینئر ، ڈیکمپائل یا جدا کرنے کے لیے حوصلہ افزائی ، مدد یا اختیار نہیں دیں گے ، یا بصورت دیگر ہمارے سافٹ وئیر کے ساتھ چھیڑ چھاڑ کریں گے چاہے وہ مکمل ہو یا جزوی طور پر ، یا اس سے کوئی مشتق کام تخلیق کریں سافٹ ویئر\r\n\r\nسافٹ ویئر کو اپ ٹو ڈیٹ رکھنے کے لیے ، ہم کسی بھی وقت اور آپ کو نوٹس کے بغیر خودکار یا دستی اپ ڈیٹ پیش کر سکتے ہیں۔', '2021-10-12 17:09:33', '2021-10-12 17:10:56'),
(25, 'CONDITIONS OF SALE (BETWEEN SELLERS AND CUSTOMERS)', 'Please read these conditions carefully before placing an order for any products with the Sellers (\"We\" or \"Our\" or \"Us\", wherever applicable) on the Site. These conditions signify your agreement to be bound by these conditions.', 'براہ کرم سائٹ پر بیچنے والے (\"ہم\" یا \"ہمارے\" یا \"ہم\" ، جہاں بھی قابل اطلاق ہو) کے ساتھ کسی بھی مصنوعات کے لیے آرڈر دینے سے پہلے ان شرائط کو غور سے پڑھیں۔ یہ شرائط آپ کے معاہدے کو ان شرائط کے پابند ہونے کی نشاندہی کرتی ہیں۔', '2021-10-12 17:10:19', '2021-10-12 17:11:17'),
