(87, 'Arain Bricks', 'arainbricksr2@gmail.com', 1, NULL, '$2y$10$J.eIQu/oj5sP8thF6rirBuz/z3m8mnJE1TJdoFBy0Xy7BcLyMlPNW', NULL, 'userProfile/1647261452IMG_1815.jpg', 'Nouman', 'Zulfiqar', 'mir sab road kot radha kishan', NULL, NULL, '03174094038', NULL, '60', 8, 7, 15, 1, '2022-05-13', 92, '0', 'Arain Bricks Company R2 is one of the biggest manufacturing unit in city kot radha kishen district kasur we are operating since 2010. we produce more than 60,000 bricks daily. our vision is to provide high quality bricks to our customers.', 'voOTfZ70gDAaMyZsNwIC8PAh17m9xcjV5lgQIZvTVM0ALJhKx7Ng6vFuwUA0', '2022-03-14 15:45:04', '2022-09-25 23:40:09', 0, NULL, NULL, 0),
