(90, 'Shabbir Bricks Company', 'info@shabbirbricks.com', 1, NULL, '$2y$10$FA0kilTsf6u1PdPXV6K/n.fbvItnGZlo5aev3OpME6rXL9IvWOtdS', NULL, 'userProfile/1648220635about.jpg', 'Shabbir', 'Ahmad', '37 km. Multan Road, Near Sui Gas Pipe Store Manga Mandi Lahore-Pakistan', NULL, NULL, '03008412125', '2022-03-25', '117', 8, 7, 6, 1, '2022-07-24', 240, '0', 'Shabbir Bricks Corporation having experience of bricks manufacturing more than 40 years. the company is pioneer in introducing huge variety of versatile designs of facing bricks in Pakistan.\r\n\r\nIts manufacturing items Special Gutka, Tiles, Facing Bricks & Design are being used in the Houses, Schools and Colleges, plazas and factories buildings.\r\n\r\nHistorical Mughal Art of construction is being seen in modern age due to brilliant efforts of Shabbir Bricks Corporation . Gutka Tiles and Facing bricks is attractable due to its natural and traditional look with a modern touch. Special features of Gutka Tiles facing bricks are economical and long life than other facing materials.', 'Z6pwwQNq0lIQjYDyfxdA3vOZK00U0w2WWszztQjZ2X2CwwlrzkWxKMYPb37n', '2022-03-25 17:53:12', '2022-09-29 12:26:57', 0, NULL, NULL, 0),
(91, 'Butt Bricks Company', 'info@buttbricks.com', 1, NULL, '$2y$10$GL6vn/GMhqW8sk7Gld6/te6Ai2KnaDWlL/HCsiU2DiLk4bwoaAeQi', NULL, 'userProfile/1648223362banner-home02.jpg', 'Butt', 'Bricks', 'Defence Road, Canal Bridge, Harbans Pura, Lahore, Punjab, Pakistan. (54000)', NULL, NULL, '03212222957', '2022-03-25', '118', 8, 7, 6, 1, '2022-07-24', 313, '1', 'Butt Bricks Company is a well-established and widely recognized Bricks Manufacturing Company of Lahore . They are widely recognized and respected by the professionals related with the field of constructions, Especially Architects, Engineers and Contractors.\r\n\r\nMuhammad Yaqoob Butt founded the company more than years ago in 1979. When he established the first brick kiln in area of jaloo in order to fulfill the Demand of construction industry in and around the city of Lahore . However, the popularity of their bricks broke the geographic boundaries of Lahore and soon they start receiving the orders from all over the Pakistan .\r\n\r\nThe quality of their bricks made the history of Butt Bricks Company Success Story. Today there are three brick kilns that belong to Butt Bricks Company, all located in Jallo area. These Kilns are busy round the year in the Production of quality bricks. Although Butt Bricks Company Dose Produce the First Awal quality brick, which is very much in demand, but their real strength is the production of Fair Face Bricks that are manufactured in various sizes and shapes according to the requirement and aesthetic design of the architect. Apart from the full/regular sizes fair face bricks, they manufacture Gutka in three regular sizes. More over they also manufacture the same quality face bricks in order to enhance the beauty of the buildings. The additional service provided by the company to the architects is that, they are always ready manufacture fair face bricks in new shapes as design/ or demanded by them.\r\n\r\nThe quality of the production of Butt Bricks Company is not only recognized in Pakistan . But it is also famous out side the country. So the company is a pioneer in the field of bricks export from Pakistan resulting in earning foreign exchange for the country. The Company Exports bricks to countries including USA , Saudi Arabia , UAE, South Africa , Poland and Japan.', NULL, '2022-03-25 19:29:58', '2022-10-03 06:19:54', 0, NULL, NULL, 0),
(92, 'shaheenbricks', 'info@shaheenbricks.com', 1, NULL, '$2y$10$.SOjVAtgVyx.5PE5BVgCwew8dDhtwYlLhQFPLUNQOzvFNVpgi5Q02', NULL, 'userProfile/1648446299kiln-bircks-in-pakistan-p3j5bglcacfteomiqya1isa0nhx7t0qxw6v63njz8g.jpg', 'Gull Muhammad', 'Khan', '4 K.M Burywala Road, Chack Number, Chak 35/12-L, Chichawanti, Sahiwal', NULL, NULL, '03077070105', '2022-03-28', '120', 8, 7, 39, 1, '2022-07-27', 71, '0', 'At Shaheen Bricks, we aim to deliver quality bricks to various construction sectors. Since 1992, we are associated with this business, and our top-quality bricks say it all. We are a family-owned bricks manufacturing and supplying company operating in Pakistan for over two decades. From the traditional Awwal Brick to the special Khinger brick, we manufacture them all. Our wide range of bricks includes classic clay bricks, Awwal Bricks, Doum bricks, Floor bricks, and clay tiles. Thanks to our extensive distribution network, we supply the best bricks in Pakistan. No matter what your construction requirements are, our wide range of bricks has got them covered.', NULL, '2022-03-28 09:40:32', '2022-09-28 11:51:07', 0, NULL, NULL, 0),
